import React, { Component } from 'react';
import './CompareSector.css';
import Card from 'react-bootstrap/Card';
import {Button,Form} from 'react-bootstrap';
import NavWithDropDownUser from '../UserNavBar';
import {Row,Col} from 'react-bootstrap';
import ReactFC from "react-fusioncharts";
import FusionCharts from "fusioncharts";
import charts from "fusioncharts/fusioncharts.charts";

charts(FusionCharts);

class CompareSector extends Component {
    constructor(props){
        super(props);
        this.state = {
            sectorsList : []
        }
    }
    
    componentDidMount(){
        var requestOptions = {
            method : 'GET',
            headers : {"Authorization" : "Bearer " + this.props.getAuthToken() }
        }
        fetch('http://localhost:8083/sector/getAllSectors',requestOptions)
        .then(response => {
            if(response.status === 200){
                return response.json();
            }
            return null;
        })
        .then(data => {
            if(data != null){
                this.setState({
                    sectorsList : data
                })
            }
        })
    }
    
    render(){
        return(
            <React.Fragment>
                <h1>hi</h1>
            </React.Fragment>
        );
    }
}

export default CompareSector;
